webpackJsonp([0xae04ccf54094],{2251:function(e,o){e.exports={pathContext:{docHtml:"<h1>jsdiff</h1>\n<p><a href=\"http://travis-ci.org/kpdecker/jsdiff\"><img src=\"https://secure.travis-ci.org/kpdecker/jsdiff.svg\" alt=\"Build Status\"></a>\n<a href=\"https://saucelabs.com/u/jsdiff\"><img src=\"https://saucelabs.com/buildstatus/jsdiff\" alt=\"Sauce Test Status\"></a></p>\n<p>A javascript text differencing implementation.</p>\n<p>Based on the algorithm proposed in\n<a href=\"http://citeseerx.ist.psu.edu/viewdoc/summary?doi=10.1.1.4.6927\">\"An O(ND) Difference Algorithm and its Variations\" (Myers, 1986)</a>.</p>\n<h2>Installation</h2>\n<pre><code class=\"language-bash\">npm install diff --save\n</code></pre>\n<p>or</p>\n<pre><code class=\"language-bash\">bower install jsdiff --save\n</code></pre>\n<h2>API</h2>\n<ul>\n<li>\n<p><code>JsDiff.diffChars(oldStr, newStr[, options])</code> - diffs two blocks of text, comparing character by character.</p>\n<p>Returns a list of change objects (See below).</p>\n<p>Options</p>\n<ul>\n<li><code>ignoreCase</code>: <code>true</code> to ignore casing difference. Defaults to <code>false</code>.</li>\n</ul>\n</li>\n<li>\n<p><code>JsDiff.diffWords(oldStr, newStr[, options])</code> - diffs two blocks of text, comparing word by word, ignoring whitespace.</p>\n<p>Returns a list of change objects (See below).</p>\n<p>Options</p>\n<ul>\n<li><code>ignoreCase</code>: Same as in <code>diffChars</code>.</li>\n</ul>\n</li>\n<li>\n<p><code>JsDiff.diffWordsWithSpace(oldStr, newStr[, options])</code> - diffs two blocks of text, comparing word by word, treating whitespace as significant.</p>\n<p>Returns a list of change objects (See below).</p>\n</li>\n<li>\n<p><code>JsDiff.diffLines(oldStr, newStr[, options])</code> - diffs two blocks of text, comparing line by line.</p>\n<p>Options</p>\n<ul>\n<li><code>ignoreWhitespace</code>: <code>true</code> to ignore leading and trailing whitespace. This is the same as <code>diffTrimmedLines</code></li>\n<li><code>newlineIsToken</code>: <code>true</code> to treat newline characters as separate tokens.  This allows for changes to the newline structure to occur independently of the line content and to be treated as such. In general this is the more human friendly form of <code>diffLines</code> and <code>diffLines</code> is better suited for patches and other computer friendly output.</li>\n</ul>\n<p>Returns a list of change objects (See below).</p>\n</li>\n<li>\n<p><code>JsDiff.diffTrimmedLines(oldStr, newStr[, options])</code> - diffs two blocks of text, comparing line by line, ignoring leading and trailing whitespace.</p>\n<p>Returns a list of change objects (See below).</p>\n</li>\n<li>\n<p><code>JsDiff.diffSentences(oldStr, newStr[, options])</code> - diffs two blocks of text, comparing sentence by sentence.</p>\n<p>Returns a list of change objects (See below).</p>\n</li>\n<li>\n<p><code>JsDiff.diffCss(oldStr, newStr[, options])</code> - diffs two blocks of text, comparing CSS tokens.</p>\n<p>Returns a list of change objects (See below).</p>\n</li>\n<li>\n<p><code>JsDiff.diffJson(oldObj, newObj[, options])</code> - diffs two JSON objects, comparing the fields defined on each. The order of fields, etc does not matter in this comparison.</p>\n<p>Returns a list of change objects (See below).</p>\n</li>\n<li>\n<p><code>JsDiff.diffArrays(oldArr, newArr[, options])</code> - diffs two arrays, comparing each item for strict equality (===).</p>\n<p>Options</p>\n<ul>\n<li><code>comparator</code>: <code>function(left, right)</code> for custom equality checks</li>\n</ul>\n<p>Returns a list of change objects (See below).</p>\n</li>\n<li>\n<p><code>JsDiff.createTwoFilesPatch(oldFileName, newFileName, oldStr, newStr, oldHeader, newHeader)</code> - creates a unified diff patch.</p>\n<p>Parameters:</p>\n<ul>\n<li><code>oldFileName</code> : String to be output in the filename section of the patch for the removals</li>\n<li><code>newFileName</code> : String to be output in the filename section of the patch for the additions</li>\n<li><code>oldStr</code> : Original string value</li>\n<li><code>newStr</code> : New string value</li>\n<li><code>oldHeader</code> : Additional information to include in the old file header</li>\n<li><code>newHeader</code> : Additional information to include in the new file header</li>\n<li><code>options</code> : An object with options. Currently, only <code>context</code> is supported and describes how many lines of context should be included.</li>\n</ul>\n</li>\n<li>\n<p><code>JsDiff.createPatch(fileName, oldStr, newStr, oldHeader, newHeader)</code> - creates a unified diff patch.</p>\n<p>Just like JsDiff.createTwoFilesPatch, but with oldFileName being equal to newFileName.</p>\n</li>\n</ul>\n<ul>\n<li>\n<p><code>JsDiff.structuredPatch(oldFileName, newFileName, oldStr, newStr, oldHeader, newHeader, options)</code> - returns an object with an array of hunk objects.</p>\n<p>This method is similar to createTwoFilesPatch, but returns a data structure\nsuitable for further processing. Parameters are the same as createTwoFilesPatch. The data structure returned may look like this:</p>\n<pre><code class=\"language-js\">{\n  oldFileName: 'oldfile', newFileName: 'newfile',\n  oldHeader: 'header1', newHeader: 'header2',\n  hunks: [{\n    oldStart: 1, oldLines: 3, newStart: 1, newLines: 3,\n    lines: [' line2', ' line3', '-line4', '+line5', '\\\\ No newline at end of file'],\n  }]\n}\n</code></pre>\n</li>\n<li>\n<p><code>JsDiff.applyPatch(source, patch[, options])</code> - applies a unified diff patch.</p>\n<p>Return a string containing new version of provided data. <code>patch</code> may be a string diff or the output from the <code>parsePatch</code> or <code>structuredPatch</code> methods.</p>\n<p>The optional <code>options</code> object may have the following keys:</p>\n<ul>\n<li><code>fuzzFactor</code>: Number of lines that are allowed to differ before rejecting a patch. Defaults to 0.</li>\n<li><code>compareLine(lineNumber, line, operation, patchContent)</code>: Callback used to compare to given lines to determine if they should be considered equal when patching. Defaults to strict equality but may be overriden to provide fuzzier comparison. Should return false if the lines should be rejected.</li>\n</ul>\n</li>\n<li>\n<p><code>JsDiff.applyPatches(patch, options)</code> - applies one or more patches.</p>\n<p>This method will iterate over the contents of the patch and apply to data provided through callbacks. The general flow for each patch index is:</p>\n<ul>\n<li><code>options.loadFile(index, callback)</code> is called. The caller should then load the contents of the file and then pass that to the <code>callback(err, data)</code> callback. Passing an <code>err</code> will terminate further patch execution.</li>\n<li><code>options.patched(index, content, callback)</code> is called once the patch has been applied. <code>content</code> will be the return value from <code>applyPatch</code>. When it's ready, the caller should call <code>callback(err)</code> callback. Passing an <code>err</code> will terminate further patch execution.</li>\n</ul>\n<p>Once all patches have been applied or an error occurs, the <code>options.complete(err)</code> callback is made.</p>\n</li>\n<li>\n<p><code>JsDiff.parsePatch(diffStr)</code> - Parses a patch into structured data</p>\n<p>Return a JSON object representation of the a patch, suitable for use with the <code>applyPatch</code> method. This parses to the same structure returned by <code>JsDiff.structuredPatch</code>.</p>\n</li>\n<li>\n<p><code>convertChangesToXML(changes)</code> - converts a list of changes to a serialized XML format</p>\n</li>\n</ul>\n<p>All methods above which accept the optional <code>callback</code> method will run in sync mode when that parameter is omitted and in async mode when supplied. This allows for larger diffs without blocking the event loop. This may be passed either directly as the final parameter or as the <code>callback</code> field in the <code>options</code> object.</p>\n<h3>Change Objects</h3>\n<p>Many of the methods above return change objects. These objects consist of the following fields:</p>\n<ul>\n<li><code>value</code>: Text content</li>\n<li><code>added</code>: True if the value was inserted into the new string</li>\n<li><code>removed</code>: True of the value was removed from the old string</li>\n</ul>\n<p>Note that some cases may omit a particular flag field. Comparison on the flag fields should always be done in a truthy or falsy manner.</p>\n<h2>Examples</h2>\n<p>Basic example in Node</p>\n<pre><code class=\"language-js\">require('colors')\nvar jsdiff = require('diff');\n\nvar one = 'beep boop';\nvar other = 'beep boob blah';\n\nvar diff = jsdiff.diffChars(one, other);\n\ndiff.forEach(function(part){\n  // green for additions, red for deletions\n  // grey for common parts\n  var color = part.added ? 'green' :\n    part.removed ? 'red' : 'grey';\n  process.stderr.write(part.value[color]);\n});\n\nconsole.log()\n</code></pre>\n<p>Running the above program should yield</p>\n<img src=\"images/node_example.png\" alt=\"Node Example\">\n<p>Basic example in a web page</p>\n<pre><code class=\"language-html\">&#x3C;pre id=\"display\">&#x3C;/pre>\n&#x3C;script src=\"diff.js\">&#x3C;/script>\n&#x3C;script>\nvar one = 'beep boop',\n    other = 'beep boob blah',\n    color = '',\n    span = null;\n\nvar diff = JsDiff.diffChars(one, other),\n    display = document.getElementById('display'),\n    fragment = document.createDocumentFragment();\n\ndiff.forEach(function(part){\n  // green for additions, red for deletions\n  // grey for common parts\n  color = part.added ? 'green' :\n    part.removed ? 'red' : 'grey';\n  span = document.createElement('span');\n  span.style.color = color;\n  span.appendChild(document\n    .createTextNode(part.value));\n  fragment.appendChild(span);\n});\n\ndisplay.appendChild(fragment);\n&#x3C;/script>\n</code></pre>\n<p>Open the above .html file in a browser and you should see</p>\n<img src=\"images/web_example.png\" alt=\"Node Example\">\n<p><strong><a href=\"http://kpdecker.github.com/jsdiff\">Full online demo</a></strong></p>\n<h2>Compatibility</h2>\n<p><a href=\"https://saucelabs.com/u/jsdiff\"><img src=\"https://saucelabs.com/browser-matrix/jsdiff.svg\" alt=\"Sauce Test Status\"></a></p>\n<p>jsdiff supports all ES3 environments with some known issues on IE8 and below. Under these browsers some diff algorithms such as word diff and others may fail due to lack of support for capturing groups in the <code>split</code> operation.</p>\n<h2>License</h2>\n<p>See <a href=\"https://github.com/kpdecker/jsdiff/blob/master/LICENSE\">LICENSE</a>.</p>",docPath:"argo-ci/node_modules/diff/readme",proj:"argo-ci"}}}});
